class Solution(object):
	def findRepeatedDnaSequences(self, s):
		"""
		所有 DNA 由一系列缩写为 A，C，G 和 T 的核苷酸组成，
		例如：“ACGAATTCCG”。在研究 DNA 时，识别 DNA 中的重复序列有时会对研究非常有帮助。
		编写一个函数来查找 DNA 分子中所有出现超多一次的10个字母长的序列（子串）
		--
		输入: s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"
		输出: ["AAAAACCCCC", "CCCCCAAAAA"]
		--

		:type s: str
		:rtype: List[str]
		"""
		if not s:
			return []
		n = len(s)
		res = []
		for i in range(0,n):
			# print(i)
			if i+10<n:
				temp = s[i:i+10]
				if temp not in res and s.find(temp) != s.rfind(temp) :
					res.append(temp)
		return res
a = Solution()
